from redis_client.redis_client import redis_clientfrom stores.WacomStore.wacomsotre_info import urlfrom stores.WacomStore.wacomstore_model import WacomStorefrom tasks.client import celery_app@celery_app.taskdef start_wacom_store_wacom():    wacom = WacomStore(url=url)    items = wacom.generate_info()    result = wacom.compare_data(items)    json_data = redis_client.transfer_to_json(result)    redis_client.save_data_in_redis(name='wacomstore', value=json_data)    return resultprint(start_wacom_store_wacom())